css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://www.interaa.nl/rooster/"),
               url("http://interaa.nl/rooster/") {

body {
  background-color: #F0F0F0 !important;
  font-family: Calibri, Arial, sans-serif !important;
  background: url("data:image/png;base64,") no-repeat fixed right bottom !important;
}

a {
  color: #166EA6 !important;
  text-decoration: none !important;
}

a:hover {
  color: #163E58 !important;
  text-decoration: underline !important;
}

a:visited {
  color: #166EA6 !important;
  text-decoration: none !important;
}

table {
  margin-top: 10% !important;
  border-width: 0px !important;
  width: 640px !important;
  text-align: center !important;
}

font {
  font-size: 14px !important;
  font-weight: normal !important;
}

strong > font[color="#999999"] {
  font-weight: bold !important;
  color: #123456 !important;
}

td[colspan="4"] > div > strong > font {
  color: #EEEEEE !important;
  font-weight: bold !important;
}

td[colspan="2"] > div > strong > font {
  color: #297BBA !important;
  font-weight: bold !important;
}

td[bgcolor="#006600"] {
  background-color: #444444 !important;
}

td[bgcolor="#000066"], td[bgcolor="#660000"] {
  background-color: #a0c0e0 !important;
}

td[bgcolor="#006600"], td[bgcolor="#000066"], td[bgcolor="#660000"] {
  border-width: 0px !important;
}

td[colspan="2"], td[width="25%"] > font[size="3"] {
  text-transform: capitalize !important;
}

}
